$('input[name=name]',$.pdialog.getCurrent()).bind('keydown change',function(){
    if($(this).val()){
        $('.icons label',$.pdialog.getCurrent()).hide().find('a:contains('+$(this).val()+')').parent().show();
    }else{
        $('.icons label',$.pdialog.getCurrent()).show();
    }
});
$('.icons a',$.pdialog.getCurrent()).click(function(){
    $.bringBack({'${field}':$('i',$(this)).prop("className").replace(' icon-large','')});
    return false;
});
</script>
</div>
